import React from "react";
import { Animator,FlexCenterStyle, ScrollContainer, ScrollPage, batch, Fade, FadeIn, Move, MoveIn, MoveOut, Sticky, StickyIn, ZoomIn } from "react-scroll-motion";
import Common from "./Common";
import web from '../src/images/shiv.jpg'
//importing typewriter-effect
import Typewriter from "typewriter-effect";



const Intro=()=>{
    const ZoomInScrollOut = batch(StickyIn(), FadeIn(), ZoomIn());
    const FadeUp = batch(Fade(), Move(), Sticky());
   
    return(
        <>

<div className="container-fluid">
<div className="row int">
<div className="col-lg-6">
<div className="App">
      <Typewriter
  
       onInit={(typewriter)=> {
  
       typewriter
        
       .typeString("Hi,")
         
       .pauseFor(1000)
       .deleteAll()
       .typeString("mr.shivam.work@outlook.com")
       .start();
       }}
      
       />
       <Common 
            name="mr.shivam.work@outlook.com"
            imgsrc={web}
            visit="./Services"
            btname="Download CV"
        />
       
       
    </div>
    </div>
    <div className="col-lg-1"></div>
    <div className="col-lg-5">
        <div className="im">
        <img src={web} className="image"/>
        </div>
    </div>
</div>
</div>



        </>

    );
};

export default Intro;
